                string memory uri = tokenURI(counter);
                res[counter] = Seeker(counter, uri);
            }
            counter++;
        }
        return res;
    }

    function withdraw() external payable onlyOwner {
        address _owner = owner();
        payable(_owner).transfer(address(this).balance);
    }
}
